INSERT INTO `other` (`var`, `val`) VALUES
('message', 'Письмо воля информ Тарифы от 22.08 16:48\n\nДобрый день!\nКоллеги, просьба обратить внимание на дополнительные изменения в телеканалах с 19.08.2019\n\nДругие изменения в телеканалах в августе:\n \nC 20.08.2019 г. вносим изменения в частотном диапазоне (добавляем новую тестовую частоту) в городах Обухов, Тернополь (технология ЦТВ), которые могут нести влияние на абонентов.\nПри обращении абонентов с жалобами на невозможность доступа к телеканалам согласно таблицы ниже – необходимо рекомендовать повторить повторную настройку телеканалов.\n\n\nС 23.08.2019 г. меняем частоту и модуляцию телеканалов в городах Львов, Черкассы, Ровно (технология ЦТВ).\nРаботы будут нести влияние на всех абонентов (ЦТВ/ОТТ Hybrid).\nДетальная информация в таблице, во вложении.\n*Обязательно при поиске (Ручной или Автоматический) – параметр Сетевой поиск должен быть включенным'),
('message-a', '+'),
('message-q', 'Ознакомился?'),
('SV', 'Хоптяр Вика');
